function getFloor(instructions) {
	var split = instructions.split('');
	// console.log(split)

	let position = 0

	for (let i = 0; i < split.length; i++) {
		var c = split[i];
		if (c == "(") position++;
		else if (c == ")") position--;
	}
	// console.log(position)

	return position
}